import React from 'react';
import ReactDOM from 'react-dom/client';
import { ReactKeycloakProvider } from '@react-keycloak/web';
import keycloak, { initKeycloak, logout } from './keycloak';
import App from './App';
import axios from 'axios';

// Configure axios defaults
axios.defaults.baseURL = 'http://localhost:8080';

// Ensure URL is a string
const ensureStringUrl = (url) => {
    if (typeof url === 'string') {
        return url;
    }
    if (url instanceof URL) {
        return url.toString();
    }
    if (typeof url === 'object' && url.origin) {
        return `${url.origin}${url.pathname || ''}`;
    }
    console.warn('Invalid URL format:', url);
    return window.location.origin;
};

// Function to render error message with suggestions
const renderError = (error) => {
  // Handle undefined error object
  const errorObj = error || { message: 'Unknown error during Keycloak initialization' };
  const errorDetails = errorObj.message || 'Unknown error';
  const suggestions = errorObj.suggestions || [
    'Make sure Keycloak server is running on port 9090',
    'Check CORS settings in Keycloak',
    'Verify client configuration in Keycloak',
    'Ensure Web Origins in client settings includes http://localhost:4200'
  ];

  console.error('Failed to initialize app:', errorObj);

  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(
    <div className="error-container" style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
      padding: '20px',
      backgroundColor: '#f8f9fa',
      color: '#343a40',
      fontFamily: 'Arial, sans-serif'
    }}>
      <div style={{
        maxWidth: '600px',
        padding: '30px',
        borderRadius: '8px',
        backgroundColor: 'white',
        boxShadow: '0 4px 6px rgba(0,0,0,0.1)',
        textAlign: 'center'
      }}>
        <h1 style={{ color: '#dc3545', marginBottom: '20px' }}>Authentication Error</h1>
        <p style={{ fontSize: '18px', marginBottom: '20px' }}><strong>{errorDetails}</strong></p>

        <div style={{ textAlign: 'left', marginTop: '20px' }}>
          <h3 style={{ marginBottom: '10px' }}>Troubleshooting Suggestions:</h3>
          <ul style={{ paddingLeft: '20px' }}>
            {suggestions.map((suggestion, index) => (
              <li key={index} style={{ marginBottom: '8px' }}>{suggestion}</li>
            ))}
          </ul>
        </div>

        <div style={{ marginTop: '30px' }}>
          <p>Check the browser console for more detailed error information.</p>
          <button 
            onClick={() => window.location.reload()} 
            style={{
              padding: '10px 20px',
              backgroundColor: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer',
              fontSize: '16px',
              marginTop: '10px'
            }}
          >
            Retry
          </button>
        </div>
      </div>
    </div>
  );
};

// Function to render a manual login button
const renderLoginButton = () => {
  // Create the Keycloak login URL
  const redirectUri = encodeURIComponent(window.location.origin + '/');
  const keycloakLoginUrl = `http://localhost:9090/realms/whatsapp-clone/protocol/openid-connect/auth?client_id=whatsapp-clone-app&redirect_uri=${redirectUri}&response_type=code&scope=openid`;

  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
      padding: '20px',
      backgroundColor: '#f8f9fa',
      color: '#343a40',
      fontFamily: 'Arial, sans-serif'
    }}>
      <div style={{
        maxWidth: '600px',
        padding: '30px',
        borderRadius: '8px',
        backgroundColor: 'white',
        boxShadow: '0 4px 6px rgba(0,0,0,0.1)',
        textAlign: 'center'
      }}>
        <h1 style={{ marginBottom: '20px' }}>Welcome to ChatSecure</h1>
        <p style={{ fontSize: '18px', marginBottom: '20px' }}>
          Please log in to access your messages and contacts.
        </p>

        <button 
          onClick={() => {
            try {
              console.log('Redirecting to Keycloak login URL:', keycloakLoginUrl);
              window.location.href = keycloakLoginUrl;
            } catch (error) {
              console.error('Error redirecting to Keycloak:', error);
              alert('Failed to redirect to login page. Please check the console for details.');
            }
          }} 
          style={{
            padding: '12px 24px',
            backgroundColor: '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer',
            fontSize: '16px',
            marginTop: '10px',
            marginBottom: '20px'
          }}
        >
          Log in with Keycloak (Button)
        </button>

        <p style={{ marginTop: '20px', marginBottom: '10px' }}>If the button doesn't work, try this direct link:</p>

        <a 
          href={keycloakLoginUrl} 
          target="_self"
          style={{
            display: 'inline-block',
            padding: '12px 24px',
            backgroundColor: '#28a745',
            color: 'white',
            textDecoration: 'none',
            borderRadius: '4px',
            fontSize: '16px'
          }}
        >
          Direct Login Link
        </a>

        <div style={{ marginTop: '30px', padding: '15px', backgroundColor: '#f8f9fa', borderRadius: '4px' }}>
          <p><strong>Debug Information:</strong></p>
          <p style={{ wordBreak: 'break-all' }}><strong>Login URL:</strong> {keycloakLoginUrl}</p>
          <p><strong>Current Origin:</strong> {window.location.origin}</p>
        </div>
      </div>
    </div>
  );
};

const initApp = async () => {
    try {
        console.log('Showing manual login button instead of automatic initialization');
        renderLoginButton();
        return;

        // The original automatic initialization code is commented out below
        /*
        console.log('Starting Keycloak initialization...');
        const authenticated = await initKeycloak();
        console.log('Keycloak initialized, authenticated:', authenticated);

        // Render your app
        const root = ReactDOM.createRoot(document.getElementById('root'));
        root.render(
            <React.StrictMode>
                <App />
            </React.StrictMode>
        );
        */
    } catch (error) {
        console.error('Failed to initialize app:', error);
        renderError(error);
    }
};

// Start the app
initApp();
